import { Container, Row, Col} from 'react-bootstrap'

const Index = props => {
    return (
      <Container>
        <Row>
          <p>Hello Next.js</p>
          <Col>
            <p>Item 1</p>
            <p>Item 2</p>
            <p>Item 3</p>
          </Col>
        </Row>
      </Container>
    );
  }

  Index.getInitialProps = async ()=>{
    return {}
  }

  export default Index;
